        <div className="day-card">
            <div className="day-image">
            <img  alt="snow" src={snow} />

            </div>
            <div><p>{`${Math.round(weather?.list?.[index].main.temp_max - 273)}C`}  {`${Math.round(weather?.list?.[index].main.temp_min - 273)}C`}</p></div>
